import React , { Component } from 'react'
import ServiceDt from './ServiceDt'
class DataSummary extends Component {
    constructor (props){
        super(props)
        }
    render() {
        return(
            <div>
                <table border="3" text-align='center' width = '80%' >
                    <tr>
                        <th>Total Customer</th>
                        <th>Tip</th>
                    </tr>
                    <tr>
                        <th>{this.props.summCount}</th>
                        <th>{this.props.summTip}</th>
                    </tr>
                </table>
            </div>

        )
    }
}

export default DataSummary
